import _ from "lodash";

export function getSum(transaction) {
  let sum = _(transaction)
    .groupBy("type")
    .map((obj, key) => {
        return _.sumBy(obj, "amount")
    //   if (!type) return _.sumBy(obj, "amount");
    //   return {
    //     'type': key,
    //     'color': obj[0].color,
    //     'total': _.sumBy(obj, "amount"),
    //   };
    })
    .value();
  console.log(sum);
}
export function getLabels() {}
